import java.util.List;
import java.util.Map;

/**
 * FiLinkOceanConnectSender测试类
 *
 * @author CongcaiYu
 */
@RunWith(JMockit.class)
public class FiLinkOceanConnectSenderTest {

    @Tested
    private FiLinkOceanConnectSender FiLinkOceanConnectSender;

    @Injectable
    private Map<String, RequestResolver> requestHandlerMap;

    @Injectable
    private SendUtil sendUtil;

    @Injectable
    private CommonUtil commonUtil;

    @Injectable
    private ProtocolUtil protocolUtil;

    @Mocked
    private RedisUtils redisUtils;

    private FiLinkProtocolBean fiLinkProtocolBean;

    @Before
    public void setUp() throws Exception {
        String hexFile1 = "";
        String hexFile2 = "";
        byte[] bytes = HexUtil.hexStringToByte(hexFile1+hexFile2);
        InputStream fileInputStream = new ByteArrayInputStream(bytes);
        fiLinkProtocolBean = new FiLinkProtocolResolver().resolve(fileInputStream);
    }

    @Test
    public void send() {
        String data = "FFEF01019AC16BD40424A50A003142474D50303500002208000100000000001F000000005D107D4900000001000039030000047F7F7F000000000000000000";
        Map<String, Object> unlockParam = new HashMap<>(64);
        unlockParam.put("slotNum", "1");
        unlockParam.put("operate", "0");
        Map<String, Object> unlockMap = new HashMap<>(64);
        List<Map<String, Object>> paramList = new ArrayList<>();
        paramList.add(unlockParam);
        unlockMap.put("params", paramList);
        //开锁请求参数
        FiLinkReqOceanConnectParams unlockReq = new FiLinkReqOceanConnectParams();
        unlockReq.setToken("4a2f824d-c813-4451-b340-15348ce09a6e");
        unlockReq.setCmdId(CmdId.UNLOCK);
        unlockReq.setEquipmentId("0101CFED4C0400000000");
        unlockReq.setSerialNumber(1);
        unlockReq.setCmdType(CmdType.REQUEST_TYPE);
        unlockReq.setParams(unlockMap);
        unlockReq.setProtocolBean(fiLinkProtocolBean);
        FiLinkOceanConnectSender.send(unlockReq, data);
    }

    @Test
    public void getReqData() {
        //开锁请求帧
        new Expectations() {
            {
                RedisUtils.hSet(RedisKey.UNLOCK_PUSH, anyString, any);
            }

            {
                RedisUtils.hSet(RedisKey.CMD_RESEND_BUFFER, anyString, any);
            }
        };
        Map<String, Object> unlockParam = new HashMap<>(64);
        unlockParam.put("slotNum", "1");
        unlockParam.put("operate", "0");
        Map<String, Object> unlockMap = new HashMap<>(64);
        List<Map<String, Object>> paramList = new ArrayList<>();
        paramList.add(unlockParam);
        unlockMap.put("params", paramList);
        //开锁请求参数
        FiLinkReqOceanConnectParams unlockReq = new FiLinkReqOceanConnectParams();
        unlockReq.setToken("4a2f824d-c813-4451-b340-15348ce09a6e");
        unlockReq.setCmdId(CmdId.UNLOCK);
        unlockReq.setEquipmentId("0101CFED4C0400000000");
        unlockReq.setSerialNumber(1);
        unlockReq.setCmdType(CmdType.REQUEST_TYPE);
        unlockReq.setParams(unlockMap);
        unlockReq.setProtocolBean(fiLinkProtocolBean);
        FiLinkOceanConnectSender.getReqData(unlockReq);

        //serialNum为空
        unlockReq.setSerialNumber(null);
        FiLinkOceanConnectSender.getReqData(unlockReq);

        //redis serialNum不为空
        unlockReq.setSerialNumber(null);
        FiLinkOceanConnectSender.getReqData(unlockReq);
    }
}